import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

function createData(name, calories, fat, carbs, protein) {
return { name, calories, fat, carbs, protein };
}

const rows = [
createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
createData('Eclair', 262, 16.0, 24, 6.0),
createData('Cupcake', 305, 3.7, 67, 4.3),
createData('Gingerbread', 356, 16.0, 49, 3.9),
];

export default function EmployeeSchedule(props) {
return (
    <div>
    <ul>
    {props.schedule.mon.map(item => (
    	// <p>{item['09h'].duration}</p>
        <p>{Object.keys(item)[0]}</p>
    ))}
    </ul>
    {/* <h1>{props.schedule.mon[0]['11h00']['duration']}</h1> */}
    <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} size="small" aria-label="a dense table">
            <TableHead>
                <TableRow>
                    <TableCell align="center" colSpan={3}>Monday</TableCell>
                    <TableCell align="center" colSpan={3}>Tuesday</TableCell>
                    <TableCell align="center" colSpan={3}>Wednesday</TableCell>
                    <TableCell align="center" colSpan={3}>Thursday</TableCell>
                    <TableCell align="center" colSpan={3}>Friday</TableCell>
                </TableRow>
                <TableRow>
                    <TableCell align="center">Time</TableCell>
                    <TableCell align="center">Description</TableCell>
                    <TableCell align="center">Duration</TableCell>
                    <TableCell align="center">Time</TableCell>
                    <TableCell align="center">Description</TableCell>
                    <TableCell align="center">Duration</TableCell>
                    <TableCell align="center">Time</TableCell>
                    <TableCell align="center">Description</TableCell>
                    <TableCell align="center">Duration</TableCell>
                    <TableCell align="center">Time</TableCell>
                    <TableCell align="center">Description</TableCell>
                    <TableCell align="center">Duration</TableCell>
                    <TableCell align="center">Time</TableCell>
                    <TableCell align="center">Description</TableCell>
                    <TableCell align="center">Duration</TableCell>
                </TableRow>
            </TableHead>
            {/* <TableBody>
                {rows.map((row) => (
                    <TableRow
                    key={row.name}
                    sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                    >
                    <TableCell component="th" scope="row" align="center">{row.name}</TableCell>
                    <TableCell align="center">{row.calories}</TableCell>
                    <TableCell align="center">{row.fat}</TableCell>
                    <TableCell align="center">{row.carbs}</TableCell>
                    <TableCell align="center">{row.protein}</TableCell>
                    </TableRow>
                ))}
            </TableBody> */}
            <TableBody>
                {props.schedule.mon.map((item) => (
                    Object.values(item).map((clk, clkId) => (<TableCell component="th" scope="row" align="center">{clk}</TableCell>))
                    // <TableCell component="th" scope="row" align="center">{Object.keys(item)[0]}</TableCell>
                    // item.map((clk) => (
                    //     <TableRow
                    //     // key={Object.keys(item[0])[0]}
                    //     sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                    //     >
                    //         <TableCell component="th" scope="row" align="center">{Object.keys(clk)[0]}</TableCell>
                    //         {/* <TableCell align="center">{row.calories}</TableCell>
                    //         <TableCell align="center">{row.fat}</TableCell>
                    //         <TableCell align="center">{row.carbs}</TableCell>
                    //         <TableCell align="center">{row.protein}</TableCell> */}
                    //     </TableRow>
                    // ))
                ))}
            </TableBody>
        </Table>
    </TableContainer>
    </div>
);
}
